import React from "react";
import "./styles.css";

function Dashboard() {
  const user = { name: "User", tasks: 5, messages: 3 };

  return (
    <div className="container">
      <h2>Dashboard</h2>
      <p>Welcome, {user.name}</p>

      <div className="cards">
        <div className="card">Tasks Assigned: {user.tasks}</div>
        <div className="card">Messages: {user.messages}</div>
      </div>
    </div>
  );
}

export default Dashboard;
